Logo\"/>&nbsp;</th>\n		<th width=\"180\"><div><img src=\"http://exmail.qq.com/zh_CN/htmledition/images/bizmail/top_biz.gif\" class=\"mailBg\"/></div></th>\n		<td rowspan=\"2\" class=\"border borderRight\"></td>\n	</tr>\n	<tr>\n		<td colspan=\"2\">\n			<p style=\"margin-top:20px;\"></p>\n			<p></p>\n			<p> <a href=\"http://exmail.qq.com/login\" target=\"_blank\">http://exmail.qq.com/login</a> <a href=\"http://service.exmail.qq.com/cgi-bin/help?subtype=1&&id=28&&no=1000564\" target=\"_blank\"></a></p>\n			<p> 50MB 2GB </p>\n			<p>\n			<img src=\"http://exmail.qq.com/zh_CN/htmledition/images/bizmail/icon_bindwx.png\" style=\"vertical-align:middle;margin-right:4px\" height=\"18\" width=\"18px\"/>\n			<strong></strong><br/>\n			<span style=\"margin-left:27px;\"> <br/></span>\n			<span style=\"margin-left:27px;\"> <a href=\"https://exmail.qq.com/cgi-bin/setting_wxbind?action=get\" onclick=\"if(location.href.indexOf(\'file://\')==-1){location.href=\'/cgi-bin/setting_wxbind?action=get&sid=$SID$\';return false;}\"></a></span>\n			</p>\n			<p>\n			<img src=\"http://exmail.qq.com/zh_CN/htmledition/images/bizmail/icon_bindqq.png\" style=\"vertical-align:middle;margin-right:4px\" height=\"18\" width=\"18px\"/>\n			<strong>QQ</strong><br/>\n			<span style=\"margin-left:27px;\">QQ<br/></span>\n			<span style=\"margin-left:27px;\"> <a href=\"https://exmail.qq.com/cgi-bin/setting_remind?sid=$SID$&action=list\" onclick=\"if(location.href.indexOf(\'file://\')==-1){location.href=\'/cgi-bin/setting_remind?sid=$SID$&action=list\';return false;}\">QQ</a></span>\n			</p>\n			<p>\n				<img src=\"http://exmail.qq.com/zh_CN/htmledition/images/bizmail/icon_exsfile.gif\" style=\"vertical-align:middle;margin-right:4px\" height=\"18\" width=\"18px\"/>\n				<strong></strong><br/>\n				<span style=\"margin-left:27px;\"></span>\n			</p>\n			\n			<p>\n				<img src=\"http://service.mail.qq.com/images/faq/foxmail_icon_16_blue.png\" style=\"vertical-align:middle;margin-right:4px\" height=\"18\" width=\"18px\"/>\n				<strong>Foxmail</strong><br/>\n				<span style=\"margin-left:27px;\">Foxmail<br/></span>\n				<span style=\"margin-left:27px;\">2G<a href=\"http://exmail.qq.com/cgi-bin/readtemplate?t=bizmail_foxmail_introduce\" target=\"_blank\"></a></span>\n			\n			<p style=\"margin-left:27px;\">\n				<a href=\"http://exmail.qq.com/portal/product/function\" target=\"_blank\"></a>\n			</p>\n			<p>\n				 <a href=\"mailto:bizsupport@qq.com\">bizsupport@qq.com</a> \n			</p>\n			<p class=\"team\">\n				<br />\n				<span style=\"background:#ddd;height:1px;width:100%;overflow:hidden;display:block;margin:2px 0;\"></span>\n				<a href=\"http://exmail.qq.com\" target=\"_blank\">http://exmail.qq.com</a><br/>\n				<a href=\"http://service.exmail.qq.com\" target=\"_blank\">http://service.exmail.qq.com</a>	\n			</p>\n		</td>\n	</tr>\n	<tr>\n		<td colspan=\"4\"  style=\"vertical-align:top;line-height:5px;overflow:hidden;font-size:0;\"><img src=\"http://exmail.qq.com/zh_CN/htmledition/images/newicon/sysmail/mail_invite_bottom.png\" alt=\"\" /></td>\n	</tr>\n</table>\n</div>\n</body>\n</html>\n\r\n', '2014-08-29 18:49:54', '', '2052751705', '0', null, 'support@peisheyun.com');
